        headers: {
            'x-rapidapi-host': 'pokemon-go1.p.rapidapi.com',
            'x-rapidapi-key': 'bc4edf657cmsh2cbf34710c41280p11e9d8jsn5ba7414043d2'
        }
    };

    axios.request(options).then(function (response) {
	    console.log(response.data);
    }).catch(function (e) {
	console.error(e);
    });

